import React from 'react'

export const UsersList = ({ usersData }) => {
    return (
        <div className="list-users">
            {usersData.map(el => (
                <div key={el.id} className="list-users__wrapper">
                    <p className="list-users__item list-users__first-name">{el.firstName}</p>
                    <p className="list-users__item list-users__last-name">{el.lastName}</p>
                    <p className="list-users__item list-users__dob">{el.dob}</p>
                </div>
                ))
            }
        </div>
    )
}
